import headerLogo from '../images/logo.svg';
import { Link } from 'react-router-dom';
import App from './App';


function Header(props) { 
  return (
    <header className="header">
      <img className="header__logo" src={headerLogo} alt="Логотип"/>
      <p className={'header__email ' + (props.loggedIn ? 'header__email_shown' : '')} > {props.email}
        </p>
      <Link to="/sign-up" className={`header__button `+ (props.loggedIn ? " header__button_shown" : "")}>
        <p className="header__text">{props.header}</p>
      </Link>
      <Link to="sign-in" className={`header__button `+ (props.registered ? " header__button_shown" : "")}>
      <p className="header__text">{props.header}</p>
      </Link>
    </header>
  )
}
export default Header;
